import Sketch from "react-p5";

export default function SketchComponent() {
  return (
    <div>
      <Sketch setup={setup} draw={draw} />
    </div>
  );
}

function setup(p5, canvasParentRef) {
  p5.createCanvas(200, 400).parent(canvasParentRef);
}

function draw(p5) {
  p5.background(200);
  p5.ellipse(200, 200, 50, 50);
}
